import React from 'react'
import { ICars } from '../../types/types'
import { useParams, useLocation } from 'react-router-dom'

export default function SingleCar() {
  const location = useLocation();
  let car = location.state.car;


  return (
    <div className='car-container'>
      <div className='car-block'>
        <div className='car-info'>
          <div className="car-image">
          <img src={`${process.env.PUBLIC_URL}/assets/${car.Model_ID}.jpg`} width="270" height="200" alt="car" />
          </div>
          <p>{car.Make_Name}</p>
          <p>{car.Model_Name}</p>
          <p>{car.year}</p>
          <p>{car.color}</p>
          <p>{car.engine}</p>
          {car.transmission && <p>Transmission: {car.transmission}</p>}
          {car.fuelCapacity && <p>Fuel capacity: {car.fuelCapacity} km</p>}
        </div>
      </div>
    </div>
  )
}
